  const {data} = props;
  const [loading,setLoading]=false;
  console.log(data);
  return (
    <div className="card-item">
      <Link to={`/image/${data.id}`}>
        <div className="card-inner">
          <div className="card-top">
            <img src={data.largeImageURL}  alt={data.tags}/>
          </div>
        </div>
      </Link>
    </div>
  );
};

export default ImageCard;
